USE Hopepital_DBStore;

IF EXISTS (SELECT * FROM dbo.sysobjects WHERE id = OBJECT_ID(N'dbo.Date_Dimension') AND OBJECTPROPERTY(id, N'IsUserTable') = 1)
DROP TABLE dbo.Date_Dimension 
;
create table Date_Dimension (
date_key int not null,
full_date datetime,
day_of_week int,
day_num_in_month int,
day_num_overall int,
day_name nvarchar(50),
day_abbrev nvarchar(50),
weekday_flag nvarchar(50),
week_num_in_year int,
week_num_overall int,
week_begin_date datetime,
week_begin_date_key int,
month tinyint,
month_num_overall int,
month_name nvarchar(50),
month_abbrev nvarchar(50),
quarter int,
year int,
yearmo int,
fiscal_month int,
fiscal_quarter int,
fiscal_year int,
last_day_in_month_flag nvarchar(50),
same_day_year_ago_date datetime,
primary key (date_key))
;

